import React, {useEffect, useState, useNavigate} from "react"
import axios from "axios"
import { Tarjetavercuentas } from "../../Componentes/Cuentas/Tarjetavercuentas"
function Vercuentas() {
    const navigate = useNavigate()
  useEffect(() => {
    if(localStorage.getItem("IdUsuario")||localStorage.getItem("TokenUsuario")){
      navigate("/")
    }
  }, []); 
    const token="eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjYyYTYyZTM4MDBiMTJhY2Y1Yzk2YzBhYyIsImlhdCI6MTY1NTEzOTgwMCwiZXhwIjoxNjU1MjI2MjAwfQ.STKSJBTXBPJV2RCkf6JpVT0zP0cSyZWAyjqVAp5zQ6c"
    const [cuentas, setCuentas] = useState([])

    useEffect(()=>{
        axios.get("/cuentas",{ headers: {"x-access-token" : `${token}`} })
        .then(response => setCuentas(response.data))
        .catch(error => console.log(error))
    },[])

      
    return <div className='grid grid-cols-3 gap-2'>
        {cuentas.filter(cuenta=> cuenta.activo===true).map(cuenta=>(
            <Tarjetavercuentas cuentadatos={cuenta} key={cuenta._id}/>
        ))}

    </div>
    
  
}

export default Vercuentas
